import styled from 'styled-components';

export const Nav = styled.nav`
    background: #000;
    width: 1920px;
    height: 78.7px;
    padding: 13px 258px 5.7px 235.5px;
    object-fit: contain;
    // margin-top: -80px;
    justify-content: center;
    align-items: center;
    font-size: 1rem;
    position: sticky;
    top: 0;
    z-index: 10;

`

export const NavbarContainer = styled.div`
    display: flex;
    justify-content: space-between;
    height: 80px;
    z-index: 1;
    width: 100%;
    padding: 0 24px;
    max-width: 1100px;
`

export const Logo = styled.a`
    background-image: url('https://i.pinimg.com/236x/05/52/37/055237cde9e33fc7b4e4146289731648.jpg');
    width: 62px;
    height: 60px;
    margin: 0 38.5px 0 0;
    object-fit: contain;

`

export const HomeLink = styled.a`
display: flex;
width: 18px;
height: 22px;
margin: 16px 50px 22px 38.5px;
object-fit: contain;

`

export const DotVideoLink = styled.a`
display: flex;
width: 72px;
height: 22px;
margin: 16px 50px 22px;
object-fit: contain;
`

export const FollowLink = styled.a`
writing-mode: horizontal-tb;
display: flex;
width: 54px;
height: 22px;
margin: 16px 869.9px 22px 50px;
object-fit: contain;
`
